import { mdx } from '@mdx-js/react'

/* @jsx mdx */
import { waynedahlberg } from "@/authors";
import image from "./tailwind.jpg";
export const meta = {
  title: `Test post from my iPad`,
  description: `This post was created in Working Copy.`,
  date: "2020-11-07T14:24:00.000Z",
  authors: [waynedahlberg],
  image,
  discussion: "https://github.com/tailwindlabs/tailwindcss/discussions/2511"
};
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  meta
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`I've been on the hunt for a solid blogging solution. Static site generators like Jekyll and Gatsby were very appealing to me, but the configuration and setup was bumpy. I found myself learning more about react routes and obscure javascript that I needed for a simple blog. `}</p>
    <p>{`I also wanted by blog to look and feel nice. A clean interface that let the content shine.`}</p>
    </MDXLayout>;
}

